import React from 'react';
import ReactDOM from 'react-dom';

//React component

const App=()=>{
    return (
    <div>
        <label htmlFor="iteminput">Enter Item</label>
        <input className="item" name="iteminput"/>
        <ul>
            <li></li>
        </ul>
    </div>
    );
};

ReactDOM.render(<App />,document.querySelector('#root'));
